import Layout from "../components/Layout";
import Tile from "../components/Tile";

const Home = () => (
    <Layout>
        <h1>Projects</h1>
        <br></br>
        <ul>
            <li><Tile></Tile></li>
            <li><Tile></Tile></li>
        </ul>
            <Tile h1="Statistics Calculator" 
            src={"/calculator.png"}
            title="Machine Learning"
            text="Two predictive machine learning models on determining new policyholders' risk 
            on car insurance claims, and secondly for music taste by location.">
            </Tile>

    </Layout>
);

export default Home;
